import React from 'react'
import Selection from '../components/selection';

const Home = (props) => {
    const { cards, onCardClick, order } = props;
    return (
        <div className="wrapper text-white p-4">
            <Selection cards={cards}
                onCardClick={onCardClick}
                order={order} />
        </div>
    )
}

export default Home;
